The alloc crate is shipped with the standard Rust distribution. To import the crate you can directly use it without declaring it as a dependency in your Cargo.toml file. #![feature(alloc)] extern crate alloc; use alloc::vec::Vec; To be able to use any collection you'll first need use the global_allocator attribute to declare the global allocator your program will use. It's required that the allocator you select implements the GlobalAlloc trait. For completeness and to keep this section as self-contained as possible we'll implement a simple bump pointer allocator and use that as the global allocator. However, we strongly suggest you use a battle tested allocator from crates.io in your program instead of this allocator. // Bump pointer allocator implementation extern crate cortex_m; use core::alloc::GlobalAlloc;
use core::ptr; use cortex_m::interrupt; // Bump pointer allocator for *single* core systems
struct BumpPointerAlloc { head: UnsafeCell<usize>, end: usize,
} unsafe impl Sync for BumpPointerAlloc {} unsafe impl GlobalAlloc for BumpPointerAlloc { unsafe fn alloc(&self, layout: Layout) -> *mut u8 { // `interrupt::free` is a critical section that makes our allocator safe // to use from within interrupts interrupt::free(|_| { let head = self.head.get(); let align = layout.align(); let res = *head % align; let start = if res == 0 { *head } else { *head + align - res }; if start + align > self.end { // a null pointer signal an Out Of Memory condition ptr::null_mut() } else { *head = start + align; start as *mut u8 } }) } unsafe fn dealloc(&self, _: *mut u8, _: Layout) { // this allocator never deallocates memory }
} // Declaration of the global memory allocator
// NOTE the user must ensure that the memory region `[0x2000_0100, 0x2000_0200]`
// is not used by other parts of the program
#[global_allocator]
static HEAP: BumpPointerAlloc = BumpPointerAlloc { head: UnsafeCell::new(0x2000_0100), end: 0x2000_0200,
}; Apart from selecting a global allocator the user will also have to define how Out Of Memory (OOM) errors are handled using the unstable alloc_error_handler attribute. #![feature(alloc_error_handler)] use cortex_m::asm; #[alloc_error_handler]
fn on_oom(_layout: Layout) -> ! { asm::bkpt(); loop {}
} Once all that is in place, the user can finally use the collections in alloc . #[entry]
fn main() -> ! { let mut xs = Vec::new(); xs.push(42); assert!(xs.pop(), Some(42)); loop { // .. }
} If you have used the collections in the std crate then these will be familiar as they are exact same implementation.

